CREATE TABLE IF NOT EXISTS HECHOS_HOMICIDIOS (
  ID varchar(15) NOT NULL,
  N_VICTIMAS  INT NOT NULL,
  FECHA datetime,
  ANIO  INT,
  MES  INT,
