  COMUNA INT,
  XY_CABA_POINT VARCHAR(100),
  X_LONGITUD  FLOAT,
  Y_LATITUD  FLOAT,
  PARTICIPANTES VARCHAR (30),
  VICTIMA VARCHAR (30),
  ACUSADO varchar (30),
  
  PRIMARY KEY (ID)
) ENGINE=MyISAM  DEFAULT CHARSET=latin1 AUTO_INCREMENT=26 ;


